class AudioFileSource implements ZvoogSource {
	out: GainNode;
	params: ZvoogAudioParam[];
	audioContext: AudioContext;
	rawData: Uint8Array;
	buffer: AudioBuffer;
	waves: { audio: AudioBufferSourceNode, end: number }[];
	envelopes: { when: number, duration: number, base: GainNode }[];
	afterTime: number = 0.008;
	//constructor(raw: Uint8Array) {
	//	this.rawData = raw;
	//}
	lockedState = new ZvoogPluginLock();
	state(): ZvoogPluginLock {
		return this.lockedState;
	}
	setData(base64file: string): void {
		//https://base64.guru/converter/encode/file
		//474824__j3rryz808__hard-trap-female-vocal.mp3
		//var base64file = '';

		//var t = [0, 1, 2];
		var t: number[] = [];
		try {
			var chars = atob(base64file);
			for (var i = 0; i < chars.length; i++) {
				var num = chars.charCodeAt(i);
				t.push(num);
			}
			var arr: Uint8Array;
			arr = Uint8Array.from(t);
			this.rawData = arr;
		} catch (xx) {
			console.log(xx);
		}
	}
	prepare(audioContext: AudioContext, data: string): void {
		if (this.out) {
			this.setData(data);
		} else {
			this.out = audioContext.createGain();
			this.params = [];
			this.waves = [];
			this.envelopes = [];
			this.audioContext = audioContext;
			let me = this;
			this.setData(data);
			if (this.buffer) {
				//
			} else {
				if (this.rawData) {
					this.audioContext.decodeAudioData(this.rawData.buffer, function (audioBuffer: AudioBuffer) {
						me.buffer = audioBuffer;
					});
				}
			}
		}
	}
	getOutput(): AudioNode {
		return this.out;
	}
	getParams(): ZvoogAudioParam[] {
		return this.params;
	}
	cancelSchedule(): void {
		for (let i = 0; i < this.waves.length; i++) {
			this.waves[i].audio.stop();
		}
	}
	addSchedule(when: number, tempo: number, chord: ZvoogEnvelope[], variation: number): void {
		this.cleanup();
		for (let i = 0; i < chord.length; i++) {
			this.single(when, tempo, chord[i]);
		}
	}

	busy(): number {
		if (this.buffer) {
			return 0;
		} else {
			return 1;
		}
	}



	nextClear() {
		for (let i = 0; i < this.waves.length; i++) {
			if (this.waves[i].end < this.audioContext.currentTime) {
				try {
					this.waves[i].audio.stop();
					this.waves[i].audio.disconnect();
				} catch (x) {
					console.log(x);
				}
				this.waves.splice(i, 1);
				return true;
			}
		}
		return false;
	}
	cleanup() {
		while (this.nextClear()) {
			//
		};
	}
	findEnvelope(when: number, duration: number): { when: number, duration: number, base: GainNode } {
		let envelope: { when: number, duration: number, base: GainNode } | null = null;
		for (let i = 0; i < this.envelopes.length; i++) {
			let e = this.envelopes[i];
			if (this.audioContext.currentTime > e.when + e.duration + this.afterTime) {
				envelope = e;
				break;
			}
		}
		if (!(envelope)) {
			envelope = {
				base: this.audioContext.createGain()
				, when: 0
				, duration: 0
			};
			this.envelopes.push(envelope);
			envelope.base.connect(this.out);
		}
		envelope.when = when;
		envelope.duration = duration;
		envelope.base.gain.setValueAtTime(0, 0);
		envelope.base.gain.setValueAtTime(0, when);
		envelope.base.gain.linearRampToValueAtTime(1, when + this.afterTime);
		envelope.base.gain.setValueAtTime(1, when + duration);
		envelope.base.gain.linearRampToValueAtTime(0, when + duration + this.afterTime);
		return envelope;
	};
	single(when: number, tempo: number, line: ZvoogEnvelope): void {
		let seconds = duration2seconds(tempo, duration384(line.pitches[0].duration));
		let nextPointSeconds = when + seconds;
		for (let i = 1; i < line.pitches.length; i++) {
			let seconds = duration2seconds(tempo, duration384(line.pitches[i].duration));
			nextPointSeconds = nextPointSeconds + seconds;
		}
		let e = this.findEnvelope(when, nextPointSeconds - when);
		let audioBufferSourceNode = this.audioContext.createBufferSource();
		audioBufferSourceNode.buffer = this.buffer;
		audioBufferSourceNode.connect(e.base);
		audioBufferSourceNode.start(when);
		audioBufferSourceNode.stop(nextPointSeconds + this.afterTime);
		this.waves.push({ audio: audioBufferSourceNode, end: nextPointSeconds + this.afterTime });
	}
}